Shader *TargetFIFA10::DecideShader(MaterialProperties const &properties) {
    if (properties.isTextured && properties.isAdboard)
        return FindShader("XFadeScrollTexture");
    else if (properties.isTextured && properties.isHomeCrowd)
        return FindShader("FIFACrowdh");
    else if (properties.isTextured && properties.isAwayCrowd)
        return FindShader("FIFACrowda");
    else {
        if (!properties.isSkinned) {
            if (properties.isTextured) {
                if (properties.isTransparent)
                    return FindShader("ClipTextureAlphablend");
                else {
                    if (properties.isUnlit)
                        return FindShader("Texture2x");
                    else {
                        if (properties.isReflective || properties.isShiny || properties.isMetallic)
                            return FindShader("LitTextureIrradEnvmap");
                        else {
                            if (properties.isLit)
                                return FindShader("LitTexture2x");
                            else
                                return FindShader("Texture2x");
                        }
                    }
                }
            }
            else
                return FindShader("Gouraud");
        }
        else {
            if (properties.isTextured) {
                if (properties.isTransparent)
                    return FindShader("LitTexture2Alpha2x_Skin");
                else
                    return FindShader("LitTexture2x_Skin");
            }
            else
                return FindShader("Gouraud_Skin");
        }
    }
}
